query libLayout($libId: Int, $libType: Int) {
 userAuth {
 reserve {
 libs(libType: $libType, libId: $libId) {
 lib_id
 is_open
 lib_floor
 lib_name
 lib_type
 lib_layout {
 seats_total
 seats_booking
 seats_used
 max_x
 max_y
 seats {
 x
 y
 key
 type
 name
 seat_status
 status
 }
 }
 }
 }
 }
}
